public void dispose() {
    TestDisposableObserver<Integer> tc = new TestDisposableObserver<Integer>();

    assertFalse(tc.isDisposed());

    tc.dispose();

    assertTrue(tc.isDisposed());

    Disposable d = Disposables.empty();

    tc.onSubscribe(d);

    assertTrue(d.isDisposed());

    assertEquals(0, tc.start);
}

